/*Table structure for table `employees` */

DROP TABLE IF EXISTS `employees`;

CREATE TABLE `employees` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `employee_number` varchar(50) DEFAULT NULL,
  `first_name` varchar(100) NOT NULL,
  `last_name` varchar(100) NOT NULL,
  `middle_name` varchar(100) DEFAULT NULL,
  `employment_status` varchar(1) DEFAULT NULL,
  `employee_type` varchar(1) DEFAULT NULL,
  `band_id` int(11) DEFAULT NULL,
  `designation_id` int(11) DEFAULT NULL,
  `job_family` varchar(1) DEFAULT NULL,
  `manager` int(11) DEFAULT NULL,
  `structure_name` int(11) DEFAULT NULL,
  `structure_name_subgroup` int(10) DEFAULT NULL,
  `birth_date` date DEFAULT NULL,
  `joined_date` date NOT NULL,
  `resigned_date` date DEFAULT NULL,
  `released_date` date DEFAULT NULL,
  `country_id` int(11) DEFAULT NULL,
  `company_location_id` int(11) DEFAULT NULL,
  `gender` varchar(1) NOT NULL,
  `marital_status` varchar(1) NOT NULL,
  `billable` varchar(1) DEFAULT NULL,
  `mobile_number` varchar(20) DEFAULT NULL,
  `work_phone_number` varchar(20) DEFAULT NULL,
  `fax_number` varchar(20) DEFAULT NULL,
  `work_email_address` varchar(100) DEFAULT NULL,
  `personal_email_address` varchar(100) DEFAULT NULL,
  `pf_number` varchar(20) DEFAULT NULL,
  `pan_number` varchar(20) DEFAULT NULL,
  `name_as_pan` varchar(20) DEFAULT NULL,
  `blood_group` varchar(10) DEFAULT NULL,
  `Remarks` text,
  `current_location_id` int(11) DEFAULT NULL,
  `title` varchar(25) DEFAULT NULL,
  `employee_photo` varchar(100) DEFAULT NULL,
  `appraisal_triggered_status` int(3) NOT NULL DEFAULT '0',
  `nonappraiseestatus` int(1) NOT NULL,
  `appraiser` int(11) DEFAULT NULL,
  `reviewer` int(11) DEFAULT NULL,
  `normaliser` int(11) DEFAULT NULL,
  `ispromotionrecommended` int(1) NOT NULL DEFAULT '0',
  `appraiserLastSubmissionDate` varchar(45) DEFAULT NULL,
  `reviewerLastSubmissionDate` varchar(45) DEFAULT NULL,
  `normalizerLastSubmissionDate` varchar(45) DEFAULT NULL,
  `hr` int(11) DEFAULT NULL,
  `ojf_survey_status` varchar(1) DEFAULT '0',
  `ojf_survey_rating` int(1) DEFAULT NULL,
  `transferred_country_id` int(11) DEFAULT NULL,
  `transferred_city_id` int(11) DEFAULT NULL,
  `message_status` enum('Y','N') NOT NULL DEFAULT 'N',
  `has_dependents` varchar(1) DEFAULT NULL,
  `highest_qualification` varchar(100) DEFAULT NULL,
  `specially_abled` varchar(10) DEFAULT 'no',
  `specially_abled_category` varchar(100) DEFAULT NULL,
  `contract_startdate` date DEFAULT NULL,
  `contract_enddate` date DEFAULT NULL,
  `lms_leave_type` varchar(2) DEFAULT NULL COMMENT 'To identify the lms entity based on current location, band and employment status',
  PRIMARY KEY (`id`),
  KEY `has_dependents` (`has_dependents`),
  KEY `employment_status` (`employment_status`),
  KEY `manager` (`manager`),
  KEY `Transferred_Ids_Index` (`transferred_country_id`,`transferred_city_id`),
  KEY `Transferred_Ids` (`transferred_country_id`,`transferred_city_id`),
  KEY `lms_leave_type` (`lms_leave_type`),
  KEY `band_id` (`band_id`),
  KEY `employee_number_idx` (`employee_number`)
) ENGINE=InnoDB AUTO_INCREMENT=4959 DEFAULT CHARSET=latin1;

